import React from 'react'
import leftimg from '../images/Rectangle.png';
function Left() {
  return (
    <div className="left">
    <div>
      <h1 className="fintech">FinTech</h1>
    </div>
      <div className="leftimg"><img src={leftimg}></img></div>
      <div className="leftpara"><p> Get ready for an amazing Banking experience!</p></div>
    </div>
  )
}

export default Left;
